import Layout from "../components/Layout";
import style from "../pages/index.module.scss";

function HomePage({ children }) {
  return (
    <Layout>
      <div className={style.div}>Welcome to Next.js!</div>
      {children}
    </Layout>
  );
}

export default HomePage;
